SimpleSideWidget.description:
Enkel widget som är till för att visa en statistiksiffra i högermarginalen givet en url och format. 

Parametrar: 
@url: url till stratum-api, 
@format: beskriver formateringen av resultatdatan. 
@root: Peka ut varifrån värdet ska hämtas t.ex "data.result"

